import React from 'react';
import { Link, Element } from 'react-scroll';
import './App.css'; // Assuming you have CSS for styling

function App() {
  return (
    <div className="App">
      <nav className="nav-links">
        <Link to="home" smooth={true} duration={500}>Home</Link>
        <Link to="forest" smooth={true} duration={500}>Forest</Link>
        <Link to="beach" smooth={true} duration={500}>Beach</Link>
        <Link to="urban" smooth={true} duration={500}>Urban</Link>
      </nav>

      <Element name="home" className="section">
        <h1>Home Page</h1>
        {/* Add content for Home Page */}
      </Element>
      <Element name="forest" className="section">
        <h1>Forest Page</h1>
        {/* Add content for Forest Page */}
      </Element>
      <Element name="beach" className="section">
        <h1>Beach Page</h1>
        {/* Add content for Beach Page */}
      </Element>
      <Element name="urban" className="section">
        <h1>Urban Page</h1>
        {/* Add content for Urban Page */}
      </Element>
    </div>
  );
}

export default App;
